/*
 * LCD 显示驱动模块
 * 基于SPI接口的128x128 LCD显示屏驱动
 * 
 * 功能：
 * - SPI接口初始化和数据传输
 * - LCD初始化和配置
 * - 像素数据写入（支持8/16/32位传输）
 * - 显示区域设置和填充
 * - 图像显示（支持任意位置和大小）
 */

#include "firmware.h"
#include "tinyprintf.h"
#include "tinytim.h"
#include "tinygpio.h"
#include <stdint.h>
#include "tinylcd.h"
#include <string.h>

/**
 * @brief SPI接口初始化
 * 
 * 配置GPIO和QSPI控制器参数：
 * - 设置GPIO使能
 * - 配置QSPI状态、中断、时钟分频等
 */
void spi_init()
{
    reg_gpio_enb = (uint32_t)0b011;
    reg_cust_qspi_status = (uint32_t)0b10000;
    reg_cust_qspi_status = (uint32_t)0b00000;
    reg_cust_qspi_intcfg = (uint32_t)0b00000;
    reg_cust_qspi_dum = (uint32_t)0;
    reg_cust_qspi_clkdiv = (uint32_t)1; // sck = apb_clk/2(div+1)
    printf("gpio_enb: %x\n", reg_gpio_enb);
    printf("qspi_status: %x\n", reg_cust_qspi_status);
    printf("qspi_intcfg: %x\n", reg_cust_qspi_intcfg);
    printf("qspi_dum: %x\n", reg_cust_qspi_dum);
    printf("qspi_clkdiv: %x\n", reg_cust_qspi_clkdiv);
}

/**
 * @brief SPI数据写入
 * @param dat 要写入的8位数据
 */
void spi_wr_dat(uint8_t dat)
{
    uint32_t wdat = ((uint32_t)dat) << 24;
    reg_cust_qspi_len = 0x80000;
    reg_cust_qspi_txfifo = wdat;
    reg_cust_qspi_status = 258;
    while ((reg_cust_qspi_status & 0xFFFF) != 1)
        ;
}

#define LCD_X_OFFSET 0
#define LCD_Y_OFFSET 0
void lcd_addr_set(uint16_t x1, uint16_t y1, uint16_t x2, uint16_t y2) {
  lcd_wr_cmd(0x2A);
  lcd_wr_data16(x1 + LCD_X_OFFSET);
  lcd_wr_data16(x2 + LCD_X_OFFSET);
  lcd_wr_cmd(0x2B);
  lcd_wr_data16(y1 + LCD_Y_OFFSET);
  lcd_wr_data16(y2 + LCD_Y_OFFSET);
  lcd_wr_cmd(0x2C);
}


/**
 * @brief LCD命令写入
 * @param cmd 要写入的命令
 */
void lcd_wr_cmd(uint8_t cmd)
{
    lcd_dc_clr;
    spi_wr_dat(cmd);
}

/**
 * @brief LCD 8位数据写入
 * @param dat 要写入的8位数据
 */
void lcd_wr_data8(uint8_t dat)
{
    lcd_dc_set;
    spi_wr_dat(dat);
}

/**
 * @brief LCD 16位数据写入
 * @param dat 要写入的16位数据
 */
void lcd_wr_data16(uint16_t dat)
{
    lcd_dc_set;
    spi_wr_dat((uint8_t)(dat >> 8));
    spi_wr_dat((uint8_t)(dat & 0xFF));
}

/**
 * @brief LCD 32位数据写入
 * @param dat 要写入的32位数据
 */
void lcd_wr_data32(uint32_t dat)
{
    lcd_dc_set;
    spi_wr_dat((uint8_t)(dat >> 24));
    spi_wr_dat((uint8_t)(dat >> 16));
    spi_wr_dat((uint8_t)(dat >> 8));
    spi_wr_dat((uint8_t)(dat & 0xFF));
}

