 //     lcd_wr_data8(0x68);
 //     break; // 横屏翻转180度
 //   }
 
   // ST7735R Gamma Sequence
   lcd_wr_cmd(0xE0);
   lcd_wr_data8(0x0F);
   lcd_wr_data8(0x1A);
   lcd_wr_data8(0x0F);
   lcd_wr_data8(0x18);
   lcd_wr_data8(0x2F);
   lcd_wr_data8(0x28);
   lcd_wr_data8(0x20);
   lcd_wr_data8(0x22);
   lcd_wr_data8(0x1F);
   lcd_wr_data8(0x1B);
   lcd_wr_data8(0x23);
   lcd_wr_data8(0x37);
   lcd_wr_data8(0x00);
   lcd_wr_data8(0x07);
   lcd_wr_data8(0x02);
   lcd_wr_data8(0x10);
 
   lcd_wr_cmd(0xE1);
   lcd_wr_data8(0x0F);
   lcd_wr_data8(0x1B);
   lcd_wr_data8(0x0F);
   lcd_wr_data8(0x17);
   lcd_wr_data8(0x33);
